    public static void main(String[] args) {
        int last = 0;
        int counter = 0;
        int streak = 0;
        int total = 0;
        int length = 1;
        for (int i = 0; i < pattern.length; i++) {
            total += pattern[i];

            if (pattern[i] == last) {
                counter++;
            } else {
                System.out.println(counter);
                if (counter > streak) streak = counter;
                counter = 1;

                length++;
            }

            last = pattern[i];
        }
        System.out.println(counter);
        System.out.println("Ones: " + String.valueOf(total));
        System.out.println("Zeroes: " + String.valueOf(pattern.length - total));

        double base = Math.ceil(Math.log(streak) / Math.log(2));
        System.out.println("Bits required: " + base);

        System.out.println("Pattern length before compression " + pattern.length + " bits");
        System.out.println("Pattern length after compression " + length + " bits");
    }
